import React, { Component } from 'react';
import './Icon.css';

class Icon extends Component {
	render() {

		const style = {
			height: this.props.size,
			width: this.props.size
		}

		return (
			<img alt={this.props.name} src={'/media/icons/' + this.props.name + '.svg'} className="Icon"/>
		);
	}
}

export { Icon };
